// Function to get count of records in a table
function getCount($table, $conn) {
    $sql = "SELECT COUNT(*) AS count FROM $table";
    $result = mysqli_query($conn, $sql);
    $row = mysqli_fetch_assoc($result);
    return $row['count'];
}

